        },
      });

      setpreregistration(result.data);
    };
  });

  return (
    <div
      className="mainboard"
      style={hidesidebar ? mainboardextend : mainboard}
    >
      <div> Ön kayıtlı hasta {location.state.on_kayit_adi_soyadi}</div>
    </div>
  );
}

export default Preregistratedpatient;
